 We can use React Context to create a scope context for the Tooltip component.

## Create a Tooltip Context

Create a TooltipContext.tsx file in the components folder.
```
import { createContext, useContext } from "react";

const TooltipContext = createContext<{
  close: () => void;
}>({
  close: () => {},
});

export const TooltipProvider = TooltipContext.Provider;

export const useTooltip = () => useContext(TooltipContext);
```
## Create a Tooltip Component

Create a Tooltip.tsx file in the components folder.
```
import { ReactNode, useState } from "react";
import { TooltipProvider, useTooltip } from "./TooltipContext";

type TooltipProps = {
  children: ReactNode;
  content: ReactNode;
};

export const Tooltip = ({ children, content }: TooltipProps) => {
  const [isOpen, setIsOpen] = useState(false);
  const { close } = useTooltip();

  const handleOpen = () => {
    setIsOpen(true);
    close();
  };

  const handleClose = () => {
    setIsOpen(false);
  };

  return (
    <TooltipProvider value={{ close: handleClose }}>
      <div className="relative">
        <div
          className="cursor-pointer"
          onMouseEnter={handleOpen}
          onMouseLeave={handleClose}
        >
          {children}
        </div>
        {isOpen && (
          <div className="absolute top-0 left-0 z-10">
            <div className="bg-white rounded shadow p-2">{content}</div>
          </div>
        )}
      </div>
    </TooltipProvider>
  );
};
```
## Use the Tooltip Component

Use the Tooltip component in the pages/index.tsx file.
```
import { Tooltip } from "../components/Tooltip";

export default function Home() {
  return (
    <div>
      <Tooltip content="Hello World">
        <span>Hello World</span>
      </Tooltip>
    </div>
  );
}
```
## Conclusion

We have created a Tooltip component that can be used in different places and can close the previously opened Tooltip and so on. We have used React Context to create a scope context for the Tooltip component.

