The most basic compiler optimization is peephole optimization . It consists of a set of rules that get applied to a short sequence of target-instruction opcodes regardless of the higher-level context from which they came. It works on the assumption that, regardless of what the program is trying to do, there are some sequences that can always be done better.
For example, if you have two consecutive load operations, and the second one uses the same memory address as the first, the second one is unnecessary and can be removed.
