func main() {
    sess := session.Must(session.NewSessionWithOptions(session.Options{
        SharedConfigState: session.SharedConfigEnable,
    }))

    svc := cognitoidentityprovider.New(sess)

    input := &cognitoidentityprovider.ListUsersInGroupInput{
        GroupName: aws.String("account:6412003a7a61c0beecdd16a7"),
        UserPoolId: aws.String("us-east-2_4YtYz6hV0"),
    }

    result, err := svc.ListUsersInGroup(input)
    if err != nil {
        fmt.Println(err)
        return
    }

    for _, user := range result.Users {
        for _, attribute := range user.Attributes {
            if *attribute.Name == "custom:profileType" && (*attribute.Value == "1" || *attribute.Value == "2") {
                fmt.Println(*attribute.Value)
            }
        }
    }
}
